–í–æ—Ç –ø—Ä–∏–º–µ—Ä –∫–æ–¥–∞ –Ω–∞ —è–∑—ã–∫–µ –ø—Ä–æ–≥—Ä–∞–º–º–∏—Ä–æ–≤–∞–Ω–∏—è C#, –∫–æ—Ç–æ—Ä—ã–π —Ä–µ—à–∞–µ—Ç —ç—Ç—É –∑–∞–¥–∞—á—É:

```csharp
using System;
using System.Collections.Generic;

class Program
{
    static void Main()
    {
        // –î–∞–Ω–Ω—ã–µ –∑–∞–¥–∞—á–∏ (–≥–æ—Ä–æ–¥–∞ –∏ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏—è –º–µ–∂–¥—É –Ω–∏–º–∏)
        int[,] distances = new int[5, 5]
        {
            {0, 4, 8, 12, 16},
            {4, 0, 7, 11, 15},
            {8, 7, 0, 9, 13},
            {12, 11, 9, 0, 5},
            {16, 15, 13, 5, 0}
        };

        // –ê–ª–≥–æ—Ä–∏—Ç–º –ø–æ–∏—Å–∫–∞ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏ (–Ω–∞–ø—Ä–∏–º–µ—Ä, –∞–ª–≥–æ—Ä–∏—Ç–º –î–µ–π–∫—Å—Ç—Ä—ã)
        List<int> shortestPath = Dijkstra(distances);

        // –í—ã–≤–æ–¥ —Ä–µ–∑—É–ª—å—Ç–∞—Ç–∞
        foreach (var city in shortestPath)
        {
            Console.Write($"{city} ");
        }
        Console.WriteLine();
    }

    // –†–µ–∞–ª–∏–∑–∞—Ü–∏—è –∞–ª–≥–æ—Ä–∏—Ç–º–∞ –î–µ–π–∫—Å—Ç—Ä—ã –¥–ª—è –ø–æ–∏—Å–∫–∞ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏
    static List<int> Dijkstra(int[,] distances)
    {
        // –ò–Ω–∏—Ü–∏–∞–ª–∏–∑–∞—Ü–∏—è –º–∞—Å—Å–∏–≤–∞ —Ä–∞—Å—Å—Ç–æ—è–Ω–∏–π
        int n = distances.GetLength(0);
        bool[] visited = new bool[n];
        int[] dist = new int[n];
        int[] prev = new int[n];

        for (int i = 0; i < n; i++)
        {
            dist[i] = distances[0, i];
            prev[i] = 0;
        }

        dist[0] = 0;

        while (!visited[n - 1])
        {
            int u = FindMinDistance(dist, visited);

            visited[u] = true;

            for (int v = 0; v < n; v++)
            {
                if (!visited[v] && dist[u] + distances[u, v] < dist[v])
                {
                    dist[v] = dist[u] + distances[u, v];
                    prev[v] = u;
                }
            }
        }

        return BuildShortestPath(prev, n);
    }

    // –ü–æ–∏—Å–∫ –≥–æ—Ä–æ–¥–∞ —Å –º–∏–Ω–∏–º–∞–ª—å–Ω—ã–º —Ä–∞—Å—Å—Ç–æ—è–Ω–∏–µ–º
    static int FindMinDistance(int[] dist, bool[] visited)
    {
        int minDist = int.MaxValue;
        int minIndex = -1;

        for (int i = 0; i < dist.Length; i++)
        {
            if (!visited[i] && dist[i] < minDist)
            {
                minDist = dist[i];
                minIndex = i;
            }
        }

        return minIndex;
    }

    // –í–æ—Å—Å—Ç–∞–Ω–æ–≤–ª–µ–Ω–∏–µ –∫—Ä–∞—Ç—á–∞–π—à–µ–≥–æ –ø—É—Ç–∏
    static List<int> BuildShortestPath(int[] prev, int n)
    {
        List<int> path = new List<int>();
        int current = n - 1;

        while (current != 0)
        {
            path.Add(current);
            current = prev[current];
        }

        path.Reverse();
        return path;
    }
}
```

